const styles = StyleSheet.create({
    container: {
      flex: 1,
      position: 'absolute',
      bottom: 0,
      alignItems: 'flex-end',
      marginBottom: normalize(130),
      justifyContent: 'space-between',
      padding: normalize(4),
      paddingRight: normalize(12),
      paddingLeft: normalize(12),
    },
    row:{
        flexDirection: 'row',
        alignItems: 'center'
    },
    text: {
        color : colors.white,
        marginRight: normalize(20),
        marginLeft: normalize(20),
        fontSize: normalize(6)
    },
    icon:{
        margin: normalize(3), 
        width:normalize(30),
        height:normalize(30)
    },
    icon2:{
