        margin: normalize(2), 
        width:normalize(3),
        height:normalize(3)
    },
    row:{
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'flex-start'
    },
    photo:{
        marginTop: normalize(2), 
        width:normalize(60),
        height:normalize(60),
        borderRadius: normalize(20),
        backgroundColor: colors.black,
        borderColor: colors.secondary,
        borderWidth: 2
    }

  });

export default styles
